import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Contact from './components/Contact'
import {Route, Router} from 'react-router-dom';


function App() {
  return (
    <>
      <Navbar />
      <Router>
      <Route path='/' element={<Home/>} />
          <Contact />
      </Router>
    </>
  );
}

export default App;
